import { css } from "styled-components";

export const fontColor = {
  backgroundBlendPink: css`
    color: pink;
  `,
  lightColor: css`
    color: gainsboro;
  `,
  mainColor: css`
    color: black;
  `
};

export const defaultFontSize = css`
  font-size: 1.6rem;
`;
